import React from 'react'
import ReactDOM from 'react-dom'
import './App.css'

function Name() {
  return (
    <h1 className>Adarsh Hiremath</h1>
  );
}

function Subtitle() {
  return (
    <p>Cambridge, MA</p>
  ); 
}

function Biography() {
  return (
    <div className = "biographyContent">
      <p>i am a student at Harvard studying computer science, mathematics, and economics.</p>
      <p>my academic interests lie at the intersection of computer science</p>  
    </div>
  ); 
}

class Page extends React.Component {
  render() {
    return (
      <div className = "page">
        <div className = "name">
          <Name/>
        </div>

        <div className = "subtitle">
          <Subtitle/>
        </div>

        <div className = "biography">
          <Biography/>
        </div>
      </div>
    ); 
  }
}

// ========================================

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Page />);
